def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    for char in prefix:
        if wait_for_nl:
            if char == '\n':
                if not current_line.strip() or current_column >= column:
                    lines.append(current_line)
                    current_line = ""
                    current_column = 0
                    wait_for_nl = False
        else:
            if char == ' ':
                current_line += char
                current_column += 1
            elif char == '\t':
                current_line += char
                current_column = (current_column // 4 + 1) * 4  # adjust column position for tab
            elif char == '\n':
                lines.append(current_line)
                current_line = ""
                current_column = 0
            else:
                wait_for_nl = True
                current_line += char

    # handle remaining characters
    lines.append(current_line)

    return ''.join(lines), current_column
